import React, {useState} from 'react';

const RegisterFunc = () => {
    return (
        <div>
            <div>
                <label>Your name:</label>
                <input type={"text"}
                       placeholder={"Enter your name..."}/>
            </div>
            <div>
                <label>Your phone number:</label>
                <input type={"number"}
                       placeholder={"Enter your phone..."}/>
            </div>
        </div>
    );
};

export default RegisterFunc;
